import React from "react";
import "./contact.css"; 

export default function About() {  
  return (
    <div
      className="overflow-y-hidden" 
      id="about"
      style={{
        backgroundColor: "#e7e7e7",
        marginTop: "0",
        height: "100vh",
        fontFamily: "public-sans",
      }}
    >    
    <p className="text-center">Contact Me</p>
    </div>
  );
};
